import React from "react";

import { IconButton, Toolbar, Typography, Button } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import style from './../../assets/css/App.styles' 
import LogoGpac from "../LogoGpac";
    const ToolbarMenu :  React.FC<{}> = () => {
        const classes =style();
    return (


          <Toolbar style={{backgroundColor:"white",color:"black"}}>
              <LogoGpac edge="start" color="inherit" aria-label="menu"></LogoGpac>
          {/* <IconButton edge="start" color="inherit" aria-label="menu">
            <MenuIcon />
          </IconButton> */}
          <Typography variant="h6" className={classes.title}>
            News
          </Typography>
          <Button color="inherit">Login</Button>
          <Button color="inherit">Login2</Button>
          <Button color="inherit">Login2</Button>
        </Toolbar>

    );


}

export default ToolbarMenu;
